import React from "react";
import componentStyle from "./index.module.css";

class Title extends React.Component {
  render() {
    return (
      <div className={componentStyle["heading-primary"]}>
        <h2>
          <span>线</span>
          <span>缆</span>
          <span>系</span>
          <span>统</span>
          <span>缆</span>
          <span>缆</span>
          <span>缆</span>
          <span>缆</span>
          <span>缆</span>
          缆磁兼容性能评估软件
        </h2>
        <button type="button">Go Ahead</button>
      </div>
    );
  }
}

export default Title;
